import React from "react";
import {connect} from 'react-redux';
import Button from '@material-ui/core/Button';
import calculatorActions from '../actions/calculator';

class Calculator extends React.Component{
    render () {
        console.log(this.props);
        return (
            <div>
                <Button 
                    onClick={() => calculatorActions.fetchExpresions({
                        studentsCount: 5,
                    })(this.props.dispatch)}>
                Press me, and I will set students to redux store
                </Button>
                {this.props.isLoading && (
                    <div>
                        Завантаження
                    </div>
                )}
                {this.props.isLoading && (
                    <div style={{display: 'flex', flexDirection: 'column'}}>
                        {this.props.list.map(expression => (
                            <div>
                                {expression.name}
                            </div>
                        ))}
                    </div>
                )}

            </div>
        )
    }
}

const mapReduxStateToProps = reduxState => ({
    ...reduxState,    
});

const mapDispatchToProps = dispatch => ({
    dispatch,
});

export default connect(mapReduxStateToProps, mapDispatchToProps)(Calculator);
